import Header from './Header.js';
import Footer from './Footer.js';
import Form from './Form/Form.js';

const Teste = () => {
  const active = true;
  if (active) {
    return <p>Ativo</p>;
  } else {
    return null;
  }
}

const App = () => {
  return (
    <div>
      <Header />
      <Form />
      <Footer />
    </div>
  );
};

export default App;
